INSERT INTO `text_widgets` VALUES (1,'about-us-sidebar',NULL,'About us','Some big text about us... more and more...',1,'2024-04-14 17:26:26','2024-04-14 17:46:44'),(2,'header',NULL,'Not just copying, but learning!',NULL,1,'2024-04-14 18:11:31','2024-04-14 18:16:06'),(3,'about-page','01HVY1QBPFSD58SW16CSQVE7WX.jpg','About Us','<h2>Customizing data before saving</h2><p>Sometimes, you may wish to modify form data before it is finally saved to the database. To do this, you may define a mutateFormDataBeforeCreate() method on the Create page class, which accepts the $data as an array, and returns the modified version:</p><pre>\nprotected function mutateFormDataBeforeCreate(array $data): array\n{\n    $data[\'user_id\'] = auth()-&gt;id();\n \n    return $data;\n}</pre><p>Alternatively, if you\'re creating records in a modal action, check out the <a href=\"https://filamentphp.com/docs/3.x/actions/prebuilt-actions/create#customizing-data-before-saving\">Actions documentation</a>.</p><h2><a href=\"https://filamentphp.com/docs/3.x/panels/resources/creating-records#customizing-the-creation-process\">#</a>Customizing the creation process</h2><p>You can tweak how the record is created using the handleRecordCreation() method on the Create page class:</p><pre>\nuse Illuminate\\Database\\Eloquent\\Model;\n \nprotected function handleRecordCreation(array $data): Model\n{\n    return static::getModel()::create($data);\n}</pre><p>Alternatively, if you\'re creating records in a modal action, check out the <a href=\"https://filamentphp.com/docs/3.x/actions/prebuilt-actions/create#customizing-the-creation-process\">Actions documentation</a>.</p><p><br></p>',1,'2024-04-20 15:24:16','2024-04-20 15:24:16');
/*!40000 ALTER TABLE `text_widgets` ENABLE KEYS */;

